  public IxaPipeLexer(Reader breader, TokenFactory tokenFactory, String normalize, String options) {
    this(breader);
    this.tokenFactory = tokenFactory;
    if (normalize == null) { 
      normalize ="";
    }
    else if (normalize.equalsIgnoreCase("default")) {
         //americanize = false;
          escapeForwardSlash = false;
          normalizeBrackets = false;
          normalizeOtherBrackets = false;
          latexQuotes = true;
          unicodeQuotes = true;
          asciiQuotes = true;
          sptb3Normalize = false;
          if (options.equalsIgnoreCase("yes")) { 
            tokenizeParagraphs = true;
          }
    }
    else if (normalize.equalsIgnoreCase("ptb3")) {
        //americanize = true;
        escapeForwardSlash = true;
        normalizeBrackets = true;
        normalizeOtherBrackets = true;
        latexQuotes = true;
        unicodeQuotes = true;
        asciiQuotes = true;
        sptb3Normalize = false;
        if (options.equalsIgnoreCase("yes")) { 
          tokenizeParagraphs = true;
        }
      }  
    else if (normalize.equalsIgnoreCase("sptb3")) {
        escapeForwardSlash = true;
        normalizeBrackets = true;
        normalizeOtherBrackets = true;
        latexQuotes = true;
        unicodeQuotes = true;
        asciiQuotes = true;
        sptb3Normalize = true;
        if (options.equalsIgnoreCase("yes")) { 
          tokenizeParagraphs = true;
        }
      }
    else if (normalize.equalsIgnoreCase("ancora")) { 
        escapeForwardSlash = false;
        normalizeBrackets = false;
        normalizeOtherBrackets = false;
        latexQuotes = false;
        unicodeQuotes = false;
        asciiQuotes = true;
        sptb3Normalize = false;
        if (options.equalsIgnoreCase("yes")) { 
          tokenizeParagraphs = true;
        }
    }
    if (sptb3Normalize) {
      yybegin(SPTB3);
    }
    else {
      yybegin(PTB3);
    }
  }

